// ==UserScript==
// @name         Autodarts - Detection Error-Alert
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description
// @author       MartinHH
// @include        https://play.autodarts.io/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=autodarts.io
// @require      https://code.jquery.com/jquery-3.7.1.min.js
// @grant        GM_addStyle
// @description shows stop-sign if detection not ready
// @downloadURL https://update.greasyfork.org/scripts/511334/Autodarts%20-%20Detection%20Error-Alert.user.js
// @updateURL https://update.greasyfork.org/scripts/511334/Autodarts%20-%20Detection%20Error-Alert.meta.js
// ==/UserScript==

(function() {
    'use strict';
    var stop_image = ' data:image/png;base64,';
var interval_hand = '';
    var interval_throw = '';

    GM_addStyle("#overlay_text {position: absolute;  top: 50%;  left: 50%;  font-size: 40px;  color: white;  transform: translate(-50%,-50%);  -ms-transform: translate(-50%,-50%);  text-align: center;} ");
    GM_addStyle("#overlay_div {position: fixed;  display: none;  width: 100%;  height: 100%;  top: 0;  left: 0;  right: 0;  bottom: 0;  background-color: rgba(0,0,0,0.5);  z-index: 2;  cursor: pointer;}");
    const overlay = '<div id="overlay_div"><div id="overlay_text"><img style="width:300px; height:300px; margin-left: 150px;" src="'+stop_image+'">Die Erkennung wurde gestrt!</div></div>';
    $(document.body).append(overlay);



    function observe_hand() {
        window.interval_hand = setInterval(function() {
            console.log('Suche Hand aktiv!');
            if(   $(".chakra-button:contains('')").length > 0) {
                $('#overlay_div').show();
            }
            else {  $('#overlay_div').hide();}

        }, 2000);
    }

    function observe_throw() {
        window.interval_throw = setInterval(function() {

            if(   $(".chakra-button:contains('')").length > 0) {
                $('#overlay_div').hide();
                observe_hand();
            }

        }, 300);
    }


    $( "#overlay_div" ).on( "click", function() {
        $('button:contains("Reset")').click();
        clearInterval(window.interval_hand);
        $("#overlay_div").hide();
    });

    observe_hand();
    observe_throw();

})();